import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";
import {
  Collapse,
  Navbar,
  // NavbarToggler,
  Nav,
  NavItem,
  NavLink
} from "reactstrap";

const NavbarToggler = styled.button`
  background: #e04343;
  height: 30px;
  width: 30px;
`;

const NavBox = ({ collapsed, setCollapsed }) => {
  const toggleNavbar = () => setCollapsed(!collapsed);

  return (
    <div>
      <Navbar color="faded" light>
        <NavbarToggler onClick={toggleNavbar} />
        <Collapse isOpen={!collapsed} navbar>
          <Nav navbar>
            <NavItem>
              <NavLink href="#portfolio-section">Portfolio</NavLink>
            </NavItem>
            <NavItem>
              <NavLink
                target="_blank"
                href="https://www.linkedin.com/in/robbie-porter-85a10a82/"
              >
                LinkedIn
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink target="_blank" href="https://github.com/Hammurobbie">
                GitHub
              </NavLink>
            </NavItem>
          </Nav>
        </Collapse>
      </Navbar>
    </div>
  );
};

export default NavBox;
